import React, { Component } from 'react';
import { ListItem, ListInfo } from '../style';

class List extends Component {
	render() {
		return (
			<ListItem>
				<img 
					className='listPic'
					src='https://upload-images.jianshu.io/upload_images/10055378-d40b131c2455783e.png?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240'
					alt=''
				/>
				<ListInfo>
					<h3 className='title'></h3>
					<p className='desc'></p>
				</ListInfo>
			</ListItem>
		)
	}
}

export default List;
